import React,{useEffect, useState} from 'react'
import Login from '../Login/Login'
import Grid from '@mui/material/Grid';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import PeopleIcon from '@mui/icons-material/People';
import ApartmentIcon from '@mui/icons-material/Apartment';
import AddCircleIcon from '@mui/icons-material/AddCircle';
import ArrowRightAltIcon from '@mui/icons-material/ArrowRightAlt';
import { useNavigate } from "react-router-dom";

function Home(props) {
  useEffect(() => {
  },[]);
  
  const navigate = useNavigate();
  const [userLogged,setUserLogged] = useState(false)
  const handleLogin = () =>{
    setUserLogged(true);
  }
  const goto = (val) => {
    switch (val) {
      case 'employeeBoard':
        navigate('/Employee-Info');
        break;

      default:
        break;
    }
  }
  return (
    <div>
        {
          userLogged ? 
          <> 
            <Grid container spacing={3} style={{padding: '3rem'}}>
              <Grid item  md={4}>
                <Card>
                  <CardContent>
                    <Typography sx={{ fontSize: 20 }} color="text.secondary" gutterBottom>
                       Manage Employees Information
                    </Typography>
                    <PeopleIcon style={{ fontSize: '3rem' }} />
                  </CardContent>
                  <CardActions>
                  <Button variant="contained" size="small" onClick={goto('employeeBoard')} endIcon={<ArrowRightAltIcon />}>Goto Dashboard</Button>
                  </CardActions>
                </Card>
              </Grid>
              <Grid item  md={4}>
                <Card>
                  <CardContent>
                    <Typography sx={{ fontSize: 20 }} color="text.secondary" gutterBottom>
                      Manage Building Information
                    </Typography>
                    <ApartmentIcon style={{ fontSize: '3rem' }} />
                  </CardContent>
                  <CardActions>
                  <Button variant="contained" size="small" endIcon={<ArrowRightAltIcon />}>Goto Dashboard</Button>
                  </CardActions>
                </Card>
              </Grid>
              <Grid item md={4}>
                  <Card>
                    <CardContent>
                    <Typography sx={{ fontSize: 20 }} color="text.secondary" gutterBottom>
                       Other Information
                    </Typography>
                    <AddCircleIcon style={{ fontSize: '3rem' }} />
                    </CardContent>
                    <CardActions>
                    <Button variant="contained" size="small" endIcon={<ArrowRightAltIcon />}>Goto Dashboard</Button>
                    </CardActions>
                  </Card>
              </Grid>
            </Grid>
          </> : <Login handleLogin={handleLogin} />
        }
    </div>
  )
}

export default Home
